@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

atm:Transaction a owl:Class .
atm:TransactionAmount a owl:Class .
atm:TransactionLimit a owl:Class .
atm:TransactionStatus a owl:Class .

atm:hasAmount a owl:ObjectProperty ;
  rdfs:domain atm:Transaction ;
  rdfs:range atm:TransactionAmount .

atm:hasLimit a owl:ObjectProperty ;
  rdfs:domain atm:Transaction ;
  rdfs:range atm:TransactionLimit .

atm:hasStatus a owl:ObjectProperty ;
  rdfs:domain atm:Transaction ;
  rdfs:range atm:TransactionStatus .

atm:amountValue a owl:DatatypeProperty ;
  rdfs:domain atm:TransactionAmount ;
  rdfs:range xsd:decimal .

atm:limitValue a owl:DatatypeProperty ;
  rdfs:domain atm:TransactionLimit ;
  rdfs:range xsd:decimal .

atm:statusValue a owl:DatatypeProperty ;
  rdfs:domain atm:TransactionStatus ;
  rdfs:range xsd:string .

atm:Failed a atm:TransactionStatus ;
  atm:statusValue "Failed"^^xsd:string .
